import React from "react";


const Card = ({ id = 1 }) => {
    return (
        <div>
            <form>
                <tr>
                    <td></td><label>UserName:</label>
                </tr>
                <tr>
                    <label>Password:
                        <input type="password" />
                    </label>
                </tr>
            </form>
        </div>
    );
}

export default Card;
